import React, { Component } from "react";

class Block extends Component {
  render() {
    const { title} = this.props.block;
    return (
      <div style={divStyle}>
        <h3>{title}</h3>
      </div>
    );
  }
}

export default Block;

const divStyle = {
  background: "#7FD2F0",
  margin: "50px",
  padding: "30px"
};
